import {React} from 'react'
import { Route , Link } from 'react-router-dom';

class header extends React.Component {
    render() {

        const aa = {
            color : 'red',
            background : 'blue'
        }
        return (
            <div>
                <ul>
                    <Link to='/to' style={aa}>흐흐</Link>
                    <Link to='/about'>크크</Link>
                </ul>
            </div>
        )
    }
}

export default header;
